import React from 'react';

const HomePage = () => {
  return (
    <div style={{ position: 'relative', width: '100%', height: '100%' }}>
      <img
        src="https://i.postimg.cc/rpDbSP7q/Oracle-Brand-Voice-SAS-Sees-The-Next-Tests-For-Data-Driven-Problem-Solvers-Speed-And-Cloud.jpg"
        alt="Background"
        style={{ position: 'absolute', top: 0, left: 0, width: '300%', height: '100%', objectFit: 'cover' }}
      />
      <div style={{ position: 'relative', zIndex: 1, textAlign: 'center', color: 'white', padding: '20px' }}>
        <h1>Welcome to MyMediRecords</h1>
        <p>This is your dashboard.</p>
      </div>
    </div>
  );
};

export default HomePage;
